import React from "react";
import "./CoverScreen.css";
import {Container,Col,Row} from "react-bootstrap";
const coverScreen = props => (
  <React.Fragment>
    <Container>
      <Row>
        <Col xs></Col>
        <Col xs={{ order: 12 }}><h1>{props.name}</h1></Col>
        <Col xs={{ order: 1 }}></Col>
      </Row>
    </Container>
  </React.Fragment>
);

export default coverScreen;
